import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MainComponentContent from './components/MainComponentContent'; // La page d'accueil principale
import Generator from './components/Generator'; // La page Generator
import ActionVerite from './components/ActionVerite'; // Une autre page
import Roleplay from './components/Roleplay'; // La page Roleplay

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<MainComponentContent />} />
        <Route path="/generator" element={<Generator />} />
        <Route path="/action-verite" element={<ActionVerite />} />
        <Route path="/roleplay" element={<Roleplay />} />
      </Routes>
    </Router>
  );
};

export default App;
